// load will 'load' items by calling thingToDo for each item,
// before calling allDone when all the things to do have been done.
function loader(items, thingToDo, allDone) {
    if (!items) {
        // nothing to do.
        return;
    }

    if ("undefined" === items.length) {
        // convert single item to array.
        items = [items];
    }

    var count = items.length;

    // this callback counts down the things to do.
    var thingToDoCompleted = function (items, i) {
        count--;
        if (0 == count) {
            allDone(items);
        }
    };

    for (var i = 0; i < items.length; i++) {
        // 'do' each thing, and await callback.
        thingToDo(items, i, thingToDoCompleted);
    }
}

function loadImage(items, i, onComplete) {
    var onLoad = function (e) {
        e.target.removeEventListener("load", onLoad);

        // this next line can be removed.
        // only here to prove the image was loaded.
        document.body.appendChild(e.target);

        // notify that we're done.
        onComplete(items, i);
    }
    var img = new Image();
    img.addEventListener("load", onLoad, false);
    img.src = items[i];
}

//convertImgToBase64("nitori.png", function(base64Img){ console.log('IMAGE:',base64Img); });

function convertImgToBase64(url, callback, outputFormat){
    var canvas64 = document.getElementById('test'),
        ctx64 = canvas64.getContext('2d'),
        img = new Image;
    img.crossOrigin = 'Anonymous';
    img.onload = function(){
        canvas64.height = img.height;
        canvas64.width = img.width;
        ctx64.drawImage(img,0,0);
        var dataURL = canvas64.toDataURL('image/png');
        callback.call(this, dataURL);
        // Clean up
        canvas64 = null; 
    };
    img.src = url;
}

function getColorFromArray(array, pixel){
	var pixelValue = array[pixel];
	switch (pixelValue){
		case 0:
			return "#000000";
			break;
		case 1:
			return "#555555";
			break;
		case 2:
			return "#AAAAAA";
			break;
		case 3:
			return "#FFFFFF";
			break;
		case 4:
			return null;
			break;
	}
}

